import React from "react";
import Item from "./Item";

const ListItem = (props) => {
  return (
    <div>
   {props.items.map((expense) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
          />
          ))}
    </div>
  );
};

export default ListItem;
